pragma solidity >=0.8.2 <0.9.0;

contract BOOL {
    bool isFun;

    function Fun() public {
        isFun = true;
    }

    function notFun() public {
        isFun = false;
    }

    function reverse() public {
        isFun = !isFun;
    }

    function setFun(bool _a) public { // true, false를 넣어도 되지만, 1과 0을 넣어도 작동함
        isFun = _a;
    }

    function getFun() public view returns(bool) {
        return isFun;
    }
}

